import {createGlobalStyle} from 'styled-components';

const GlobalStyle = createGlobalStyle`
.iconfont {
  font-family: "iconfont" !important;
  font-size: 24px;
  font-style: normal;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}
`
